import React, { useState } from "react";
import axios from "axios";

function App() {
  const [url, setUrl] = useState("");
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const checkUrl = async () => {
    if (!url) {
      setError("Enter a valid URL.");
      return;
    }

    setLoading(true);
    setError("");
    setResult(null);

    try {
      const res = await axios.get(
        `http://127.0.0.1:8000/predict-url?url=${encodeURIComponent(url)}`
      );
      setResult(res.data);
    } catch (err) {
      setError("Service unavailable. Check backend.");
    }

    setLoading(false);
  };

  return (
    <div style={styles.page}>
      <div style={styles.card}>
        <h1 style={styles.title}>Phishing URL Analysis</h1>
        <p style={styles.subtitle}>
          Enterprise-grade machine learning–based phishing detection.
        </p>

        <input
          type="text"
          placeholder="https://example.com"
          value={url}
          onChange={(e) => setUrl(e.target.value)}
          style={styles.input}
        />

        <button onClick={checkUrl} style={styles.button}>
          Analyze
        </button>

        {loading && <p style={styles.info}>Running analysis…</p>}
        {error && <p style={styles.error}>{error}</p>}

        {result && (
          <div style={styles.resultBox}>
            <h2 style={styles.sectionTitle}>Analysis Summary</h2>

            <div style={styles.row}>
              <span>Final Classification:</span>
              <strong
                style={{
                  color:
                    result.final_prediction === "Phishing"
                      ? "#b3261e"
                      : "#1e7d43",
                }}
              >
                {result.final_prediction}
              </strong>
            </div>

            <div style={styles.row}>
              <span>ML Output:</span>
              <span>{result.ml_prediction}</span>
            </div>

            <div style={styles.row}>
              <span>Confidence Score:</span>
              <span>{(result.ml_probability * 100).toFixed(2)}%</span>
            </div>
          </div>
        )}
      </div>
    </div>
  );
}

// ---------------- ENTERPRISE-LEVEL STYLING ----------------

const styles = {
  page: {
    minHeight: "100vh",
    background: "#f2f3f5",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    padding: 20,
    fontFamily: "'Segoe UI', 'Roboto', sans-serif",
  },

  card: {
    width: "100%",
    maxWidth: "520px",
    background: "#ffffff",
    padding: "32px",
    borderRadius: "4px",
    border: "1px solid #d0d0d0",
    boxShadow: "0 2px 12px rgba(0,0,0,0.08)",
  },

  title: {
    fontSize: "26px",
    fontWeight: "600",
    color: "#1b1b1b",
    marginBottom: "4px",
  },

  subtitle: {
    fontSize: "14px",
    color: "#555",
    marginBottom: "28px",
  },

  input: {
    width: "100%",
    padding: "12px",
    fontSize: "15px",
    borderRadius: "4px",
    border: "1px solid #c2c2c2",
    marginBottom: "16px",
    outline: "none",
  },

  button: {
    width: "100%",
    padding: "12px",
    fontSize: "15px",
    fontWeight: "600",
    background: "#1a73e8",
    color: "#fff",
    border: "none",
    borderRadius: "4px",
    cursor: "pointer",
    marginBottom: "20px",
  },

  info: { textAlign: "center", color: "#444", fontSize: "15px" },
  error: { textAlign: "center", color: "#b3261e", fontSize: "15px" },

  resultBox: {
    padding: "18px",
    borderRadius: "4px",
    background: "#fafafa",
    border: "1px solid #dcdcdc",
  },

  sectionTitle: {
    fontSize: "18px",
    fontWeight: "600",
    marginBottom: "16px",
    color: "#222",
  },

  row: {
    display: "flex",
    justifyContent: "space-between",
    padding: "8px 0",
    borderBottom: "1px solid #e5e5e5",
    fontSize: "15px",
  },
};

export default App;
